import logo from "./logo.svg";
import "./App.css";

function App() {
  const cities = [
    {
      name: "서울",
      desc: "서울은 인구 너무 많음",
    },
    {
      name: "부산",
      desc: "부산은 해운대",
    },
    {
      name: "대구",
      desc: "대구 너무 더워",
    },
  ];
  return (
    <>
      <button>서울</button>
      <button>부산</button>
      <button>대구</button>
      <div>
        <h2> {Cities[0].name}</h2>
        <p>{Cities[0].dexc}</p>
      </div>
      <div>
        <h2> {Cities[1].name}</h2>
        <p>{Cities[1].dexc}</p>
      </div>
      <div>
        <h2> {Cities[2].name}</h2>
        <p>{Cities[2].dexc}</p>
      </div>
    </>
  );
}

export default App;
